import React from 'react';
import { ReactComponent as CommunityIcon } from '../assets/icons/Vector.svg'; // Corrected path based on file location

const Header = () => (
  <div className="header">
    <img src="https://via.placeholder.com/50" alt="Chatbot Avatar" className="avatar" />
    <button
      className="community-button"
      onClick={() => window.open('https://t.me/MrJournaler', '_blank')} // Opens the link on click
    >
      <CommunityIcon className="community-button-icon" /> {/* Use the imported SVG component */}
      <span className="community-button-text">Go to community</span>
    </button>
  </div>
);

export default Header;
